import React from "react";
function Submit(){
    const style={
        width:'500px',
        height:'50px',
        marginLeft:'100px',
        marginTop:'10px'
    }
    return(
        <div>
            <form action="">
                名字 <input type="text"/><br/>
                留言<input type="text" style={style}/> <br/>
                <button>提交</button>
            </form>
        </div>
    )
}
export default Submit
